function Password(props) {
    return(
    <div className="card">
        <h2>{props.h2}</h2>
      <div>
        <input type="checkbox" id="symbols" name="symbols" value="symbols" />
        Symbols (&, !, ? ...)
      </div>
      <div>Range : 1 - 12</div>
      <input type="range" value={1} min={1} max={12} />
    </div>
    )
}

export default Password;
